import styled from "styled-components";
import mainimage from "../../public/image/untity.png";

const Wrapper = styled.div`
    display: flex;
    justify-content: center;
    height: 100vh;
    align-items: center;
`;
const Form = styled.form`
    flex-direction: column;
    width: 500px;
    justify-content: center;
    align-items: center;
    display: flex;
`;
const Input = styled.input`
    width: 400px;
    padding: 10px;
    margin: 10px;
    border: none;
    border-radius: 5px;
    font-size: 17px;
    &[type="submit"]{
        width: 420px;
        font-weight: 600;
        background-color: cornflowerblue;
    }
`;
const Title = styled.img`
`

export default function Login(){

    return(
        <Wrapper>
            <Form>
                <Title src="/Users/parkseolho/Desktop/untity2/public/image/대표 로고.png"/>
                <Input type="text" placeholder="ID"/>
                <Input type="password" placeholder="PW"/>
                <Input type="submit" value="LOGIN"/>
            </Form>
        </Wrapper>
    );
}
